import{_ as l,A as i,a as n,o as s,X as o,e as r,b as e,f as p}from"./chunks/framework.Cp7KI1mb.js";const b=JSON.parse('{"title":"2024年09-10月振り返り","description":"","frontmatter":{"layout":"post","title":"2024年09-10月振り返り","category":"diary","tags":["diary"],"head":[["link",{"rel":"canonical","href":"https://www.codingfeline.com/2024/11/04/9to10-wrapup/"}],["meta",{"property":"og:url","content":"https://www.codingfeline.com/2024/11/04/9to10-wrapup/"}],["meta",{"property":"og:title","content":"2024年09-10月振り返り"}],["meta",{"property":"twitter:card","content":"summary_large_image"}],["meta",{"property":"twitter:site","content":"@_yshrsmz"}],["meta",{"property":"twitter:creator","content":"@_yshrsmz"}],["meta",{"property":"og:image","content":"https://www.codingfeline.com/2024/11/04/9to10-wrapup/ogp.png"}]]},"headers":[],"relativePath":"2024/11/04/9to10-wrapup/index.md","filePath":"posts/2024/2024-11-04-9to10-wrapup.md","date":{"time":"2024-11-04","string":"November 4, 2024","year":"2024","month":"11","day":"04"}}'),h={name:"2024/11/04/9to10-wrapup/index.md"};function d(m,a,c,u,f,_){const t=i("VPAmazonGoods");return s(),n("div",null,[a[0]||(a[0]=o('<p>2024年の9月-10月を振り返るよ。<br> できれば続けていきたい</p><p><strong>目次</strong></p><nav class="table-of-contents"><ul><li><a href="#仕事">仕事</a></li><li><a href="#個人プロジェクト">個人プロジェクト</a><ul><li><a href="#最近の-oss-コントリビューション一覧ページ作った">最近の OSS コントリビューション一覧ページ作った</a></li></ul></li><li><a href="#買った">買った</a><ul><li><a href="#galaxy-z-fold-6">Galaxy Z Fold 6</a></li></ul></li><li><a href="#サコッシュとか色々買って試した">サコッシュとか色々買って試した</a><ul><li><a href="#アイリスオーヤマのツインノズル型布団乾燥機">アイリスオーヤマのツインノズル型布団乾燥機</a></li><li><a href="#logicool-mx-ergo-s">Logicool MX ERGO S</a></li></ul></li><li><a href="#観た">観た</a><ul><li><a href="#トランスフォーマー-one">トランスフォーマー ONE</a></li></ul></li><li><a href="#ゲームした">ゲームした</a><ul><li><a href="#ゼルダの伝説-知恵のかりもの">ゼルダの伝説 知恵のかりもの</a></li></ul></li><li><a href="#その他">その他</a><ul><li><a href="#ホロライブにハマった">ホロライブにハマった</a></li><li><a href="#hhkb-studio-英語配列使ってみたけど挫折">HHKB Studio 英語配列使ってみたけど挫折</a></li></ul></li></ul></nav><h2 id="仕事" tabindex="-1">仕事 <a class="header-anchor" href="#仕事" aria-label="Permalink to &quot;仕事&quot;">​</a></h2><p>体調だいぶ戻ってきて、7-8月よりは動けたかな〜、という感触。事業部内の半期締め会で表彰してもらえたのもありがたい。</p><p>しかし私自身の課題もなんとなく見えてきた２ヶ月だったなあとは思ってて、そこを今後どうにかしていかんとなあ、という感じ。技術的なところはさておきマネジメント的なところになると、自分の中で一定の結論が出るとそこで思考停止してしまう部分があるというかなんというか。たとえば「今後どんどんメンテが辛くなっていくから技術的負債を解消しなければならない」という話があったとして、これをうまいことビジネスの優先度を上げてやっていかなければならないんだけど、技術負債を解消したところで直接売上に結びつくわけではないから、単純に「「技術負債解消しないと今後どんどん開発遅くなっていきますよ」的なことを説いても事業をリードする人には全然響かなかったりする。これが目先にとらわれててマジでイケてないなのは間違いないんだけど、ここをどうにか事業の成長や全社の要求と結びつけ、技術負債解消施策を動かしていけるようにするのがテックリードとか CTO 的な人の求められる動きであるのもまた間違いない。事業の進め方とか経営とかの解像度が低いというのもあるんだろうけど、「わからねえ奴らだなあ」で思考停止してしまうことがあるのでうまいやり方を探りたい。</p><p>それはそれとしてもっと気楽な立場で仕事したいとも思うわけだけど、私の興味がアーキテクチャとか、メンテナンス性の高いコードとかそういった方面なので、どこかで関わらなきゃいけないなあも思っている。まあフロントエンドだけとか私のできる範囲だったら勝手にリファクタとかしちゃうんだけどサービス全体にかかってくるとそういうわけにもいけないし。</p><h2 id="個人プロジェクト" tabindex="-1">個人プロジェクト <a class="header-anchor" href="#個人プロジェクト" aria-label="Permalink to &quot;個人プロジェクト&quot;">​</a></h2><h3 id="最近の-oss-コントリビューション一覧ページ作った" tabindex="-1">最近の OSS コントリビューション一覧ページ作った <a class="header-anchor" href="#最近の-oss-コントリビューション一覧ページ作った" aria-label="Permalink to &quot;最近の OSS コントリビューション一覧ページ作った&quot;">​</a></h3><p><a href="/recent-contributions/">このページ</a>。直近最大50件の Public な PR が表示される。</p><p>作業ログは<a href="/scraps/7/">こちら</a>。</p><p>いうて特にオリジナリティのあるところはなくて、作業ログに貼ってあるリンク先の通りに実装している。まあこのサイトは VitePress で生成される静的サイトなので、GitHub Actions でのデータ取得に置き換えてるところが独自といえば独自。</p><h2 id="買った" tabindex="-1">買った <a class="header-anchor" href="#買った" aria-label="Permalink to &quot;買った&quot;">​</a></h2><h3 id="galaxy-z-fold-6" tabindex="-1">Galaxy Z Fold 6 <a class="header-anchor" href="#galaxy-z-fold-6" aria-label="Permalink to &quot;Galaxy Z Fold 6&quot;">​</a></h3><p>実のところ Galaxy Z Fold 5 から変える必要はなかったんだけど、ドコモのいつでもカエドキプログラム+に加入してたしせっかくなら機種変するか、という流れ。</p><p>Pixel 9 Pro Fold とも迷ったけど、機能の安定性と画面の ratio 的に Galaxy のほうがまだ使いやすいかなあ、という判断。</p><p>Fold5 に引き続きケースは Latercase のスリムケースを購入したけど、サイズの合うスクリーンプロテクターがなくて大変厳しい。Fold5 のときは専用のスクリーンプロテクター売ってたんだけど、何故か今回は売ってない…。</p><h2 id="サコッシュとか色々買って試した" tabindex="-1">サコッシュとか色々買って試した <a class="header-anchor" href="#サコッシュとか色々買って試した" aria-label="Permalink to &quot;サコッシュとか色々買って試した&quot;">​</a></h2><p>今までは Cote&amp;Ciel の <a href="https://coteetciel.jp/products/inn-m-coated-canvas-black" target="_blank" rel="noreferrer">Inn M Coated Canvas Black</a> を使っていたんだけど、もう少し内部を整理したいなあと思って色々試してみた。</p>',19)),r(t,{detail:{title:"コートエシエル ショルダーバッグ INN M Cote&Ciel CC-28763",asin:"B07PLCGZHB",imageUrl:"https://m.media-amazon.com/images/I/51FdOBriSSL._AC_SY695_.jpg"}}),a[1]||(a[1]=o('<p>要件としては下記の通り</p><ul><li>iPad mini 第六世代(Apple Pencil 収納できるケース付き)が入る</li><li>上述の Cote&amp;Ciel Inn M Coated Canvas Black よりポケットや仕切りが多い</li><li>大きすぎない</li></ul><p>色々試した結果、 <a href="https://www.niid.com/products/niid-neo-ff-sling" target="_blank" rel="noreferrer">NIID NEO FF Sling</a> か、どうせ最近持ち歩いてないし iPad mini6 を考慮から外すなら <a href="https://www.amazon.co.jp/dp/B0CY9XNVFF/?tag=yslibr4ry-22&amp;th=1" target="_blank" rel="noreferrer">Bellroy Lite Sling Mini</a> かなあ、という感じ。 いろいろの内容は <a href="/scraps/8/">試したバッグ類の使い心地を書いていく</a> にまとめていこうと思う。</p><p>私本当にバッグ類好きで年中最強のバッグについて考えてるので、今後もいろいろまとめていきたい。</p><h3 id="アイリスオーヤマのツインノズル型布団乾燥機" tabindex="-1">アイリスオーヤマのツインノズル型布団乾燥機 <a class="header-anchor" href="#アイリスオーヤマのツインノズル型布団乾燥機" aria-label="Permalink to &quot;アイリスオーヤマのツインノズル型布団乾燥機&quot;">​</a></h3>',5)),r(t,{detail:{title:"アイリスオーヤマ(IRIS OHYAMA) ふとん乾燥機 ハイパワーツインノズル 新生活 KFK-402-W ホワイト",asin:"B0CKYPSMWF",imageUrl:"https://m.media-amazon.com/images/I/41SehxptOmL._AC_SX679_.jpg"}}),a[2]||(a[2]=e("p",null,"正直ツインノズルを侮っていた。吹き出し口が一つの布団乾燥機と温まり具合がぜんぜん違う。",-1)),a[3]||(a[3]=e("p",null,"ダニアレルギー対策でダニバスター機能をよく使うので、まんべんなく熱が広がってくれるのは大変ありがたい。今までは場所を変えて２回かけていたけど、新しいツインノズルの布団乾燥機では一回で全域がカバーできる。大変はかどる。",-1)),a[4]||(a[4]=e("h3",{id:"logicool-mx-ergo-s",tabindex:"-1"},[p("Logicool MX ERGO S "),e("a",{class:"header-anchor",href:"#logicool-mx-ergo-s","aria-label":'Permalink to "Logicool MX ERGO S"'},"​")],-1)),r(t,{detail:{title:"ロジクール 静音 ワイヤレス トラックボール マウス MXTB2 MX ERGO S Bluetooth Logibolt 無線 windows mac iPad OS Chrome Android トラックボールマウス マウス グラファイト 国内正規品",maker:"Logicool(ロジクール)",asin:"B0DC5X912P",imageUrl:"https://m.media-amazon.com/images/I/51adkdeLALL._AC_SX679_.jpg"}}),a[5]||(a[5]=o('<p>ついに出た新型。メインのスイッチ２つが静音仕様になったのは最初戸惑ったけど、なれれば特に気にならない、というかこちらのほうがいいかもしれない。あと USB Type-C は、正直前モデルでもアダプタをトラックボールがにつけっぱなしにしてたからあんま気にしてなかったけど、まあ楽でよいですね。機能的には私の使ってる範囲では特に良くなったとも悪くなったとも思わず。もう USB Type-C 出してくれてありがとう、というだけで買った感はある。</p><h2 id="観た" tabindex="-1">観た <a class="header-anchor" href="#観た" aria-label="Permalink to &quot;観た&quot;">​</a></h2><h3 id="トランスフォーマー-one" tabindex="-1">トランスフォーマー ONE <a class="header-anchor" href="#トランスフォーマー-one" aria-label="Permalink to &quot;トランスフォーマー ONE&quot;">​</a></h3><p>トランスフォーマーの始まりの物語的な。こういう主義主張の違いで親友同士が的になってしまう、みたいな物語は結構好き。この流れで続編出るんだろうか。</p><h2 id="ゲームした" tabindex="-1">ゲームした <a class="header-anchor" href="#ゲームした" aria-label="Permalink to &quot;ゲームした&quot;">​</a></h2><h3 id="ゼルダの伝説-知恵のかりもの" tabindex="-1">ゼルダの伝説 知恵のかりもの <a class="header-anchor" href="#ゼルダの伝説-知恵のかりもの" aria-label="Permalink to &quot;ゼルダの伝説 知恵のかりもの&quot;">​</a></h3><p>ついにタイトル回収。</p><h2 id="その他" tabindex="-1">その他 <a class="header-anchor" href="#その他" aria-label="Permalink to &quot;その他&quot;">​</a></h2><h3 id="ホロライブにハマった" tabindex="-1">ホロライブにハマった <a class="header-anchor" href="#ホロライブにハマった" aria-label="Permalink to &quot;ホロライブにハマった&quot;">​</a></h3><p>ホロARK くらいから結構観始めて、ホロGTA でガッツリハマった感じ。最初は色々ザッピングしてたんだけど、白上フブキのロールプレイがすごくて後半はほとんどその周辺を追ってた。で、そこから色々ホロメンの配信観るようになって気がついたらハマってた感じ。</p><p>いろいろ観てると「ああこの人たちの絡みは好きだなー」と思うものがいくつかあって、カップリングとか推しという概念を今になって理解してきた感じがある。</p><h3 id="hhkb-studio-英語配列使ってみたけど挫折" tabindex="-1">HHKB Studio 英語配列使ってみたけど挫折 <a class="header-anchor" href="#hhkb-studio-英語配列使ってみたけど挫折" aria-label="Permalink to &quot;HHKB Studio 英語配列使ってみたけど挫折&quot;">​</a></h3><p>ポインティングデバイス付きのキーボード捗りそう、ということで試してみた。</p><p>が、結局 Kinesis Advantage 360 と MX ERGO S に戻ってきてしまった。 トラックポイントは慣れればなんとかなりそうな気もしたけど、やはりキーが少なすぎるなあ、という感覚。具体的に言うと Fn キーを左側のどこに置こう、という話。日本語配列版まではいらないけど、もうちょいキー数ほしい。あと QMK でいうところの AUTO_SHIFT 相当の機能が捗りすぎてもう手放せないなあ、と改めて実感。とりあえずはメルカリで必要としている人のところに行ってもらった。</p><p>しかしキースイッチはまじで好みだったので、個別で買って Kinesis Advantage 360 差し替えようかな。</p><p>ポインティングデバイス付きのキーボード、次は Kickstarter で支援済みの <a href="https://naya.tech/" target="_blank" rel="noreferrer">Naya Create</a> が待ってるので楽しみ。</p>',16))])}const S=l(h,[["render",d]]);export{b as __pageData,S as default};
